import React from "react";
import styled from "styled-components";
import Navbar from "../Navbar";

export default function Contact() {
  return (
    <div>
      <Navbar />
      <ContactContainer>
        <form>
            <input type="text"/>
        </form>
        </ContactContainer>
    </div>
  );
}

const ContactContainer = styled.div`
  border: 2px solid greenyellow;
  position: relative;
  top: 80%;
`;
